// App.js
import React, { useEffect, useState } from 'react';
import './App.css';
import Calendar from './Calendar';
import axios from 'axios';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; // Import BrowserRouter, Route, Switch
import HourPicker from './HourPicker'; // Import HourPicker component

const App = () => {
  const [calendarDays, setCalendarDays] = useState([]);

  useEffect(() => {
    // Pobierz dni z backendu i ustaw je w stanie
    axios.get('http://localhost:5000/api/calendar')
      .then(response => {
        setCalendarDays(response.data);
      })
      .catch(error => {
        console.error('Error fetching calendar days:', error);
      });
  }, []);

  return (
    <Router>
      <div className="App">
        <h1>Calendar App</h1>
        <Switch>
          <Route path="/" exact>
            <Calendar calendarDays={calendarDays} />
          </Route>
          <Route path="/selecthour">
            <HourPicker />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default App;
